import React, { useReducer, useState } from 'react';


const initStateListOfMovies = {
    listOfMovies: [],
    backdrop_path: '',
    id: 0,
    poster_path: '',
    original_name: '',
    overview: ''
}

const reducer = (prevState, action) => {
    
    return {
        overview: action.value,
        backdrop_path : action.value
    }
}


const _Redux = () => {

    const [newState, dispatch] = useReducer(reducer, initStateListOfMovies)
    const [a, setA] = useState({aa : ''});
    const [b, setB] = useState({bb : ''});

    return (
        <div>
            <input type='text' name={a.aa} onChange={e => setA({...a, aa : e.target.value })} />
            <input type='text' name={b.bb} onChange={e => setB({bb: e.target.value })} />
            {a.aa} | {b.bb}
        </div>
    )
}

export default _Redux;
